help_p1:"Se te presenta una geometr\u00eda de caras. Algunas caras contienen minas (bombas), otras no. Si haces clic en una cara que contiene una bomba, pierdes. Si logras hacer clic en todas las caras (sin hacer clic en ninguna bomba) ganas.",help_p2:"Al hacer clic en una cara que no tiene una bomba se revela el n\u00famero de caras vecinas que contienen bombas. Usa esta informaci\u00f3n y un poco de trabajo para evitar las bombas. Los vecinos de la cara pueden ser las caras que comparten un borde o un v\u00e9rtice.",
help_p3:"Para abrir una cara, apunta y haz clic izquierdo sobre ella. Para marcar una cara que creas que es una bomba, apunta y haz clic derecho para colocar una bandera. Las caras marcadas no se pueden abrir. Haga clic derecho en una cara marcada para colocar un signo de interrogaci\u00f3n (se puede hacer clic en esa cara). Retire el signo de interrogaci\u00f3n haciendo clic derecho en la cara de nuevo.",help_p4:"Los 'vecinos' de una cara son las caras adyacentes arriba, abajo, izquierda, derecha y las 4 diagonales, o caras que comparten un v\u00e9rtice con la cara (V\u00e1lido en geometr\u00edas 3D). Las caras en los lados de la geometr\u00eda o en una esquina tienen menos vecinos.",
help_p5:"Si abres una cara con 0 bombas vecinas, todos sus vecinos se abrir\u00e1n autom\u00e1ticamente. Esto puede causar que un \u00e1rea grande se abra autom\u00e1ticamente.",help_p6:"Para eliminar un marcador de bomba de una cara, ap\u00fantalo y haz clic derecho nuevamente. Las caras marcadas no se pueden abrir.",help_p7:"Si marca una bomba incorrectamente, tendr\u00e1 que corregir el error antes de poder ganar. La marca de bomba incorrecta no lo mata, pero puede llevar a errores que s\u00ed lo hacen.",
help_p8:"No tienes que marcar todas las bombas para ganar; Solo necesitas abrir toda la cara sin bomba.",help_p9:"Hacer clic con el bot\u00f3n derecho dos veces le dar\u00e1 un s\u00edmbolo de signo de interrogaci\u00f3n que puede ser \u00fatil si no est\u00e1 seguro acerca de un cuadrado. Haz clic derecho nuevamente para eliminar el signo de interrogaci\u00f3n.",help_quick_start:"Inicio r\u00e1pido",import_fatal_error_content:"La biblioteca <b>{0}</b> no se pudo importar desde la ruta <i>{1}</i>",
